  shapesFromSaved(saved) {
    let shapes = [];
    let savedObjects = JSON.parse(saved);
    savedObjects.forEach((savedObject) => {
      if (savedObject.type == "POLYGON") {
        shapes.push({
          x: savedObject.position.x,
          y: savedObject.position.y,
          angle: savedObject.rotation,
          type: "polygon",
          color: savedObject.color,
          border: savedObject.border,
          borderWidth: savedObject.borderWidth,
          borderScaleWithZoom: savedObject.borderScaleWithZoom,
          points: savedObject.points.map((point) => {
            return { x: point[0], y: point[1] };
          }),
          id: savedObject.id,
          image: savedObject.image,
          imageTransformations: {
            rotate: savedObject.flipImage ? Math.PI : 0,
            scale: 1,
            translate: [0, 0]
          }
        });
      } else if (savedObject.type == "CIRCLE") {
        shapes.push({
          x: savedObject.position.x,
          y: savedObject.position.y,
          angle: savedObject.rotation,
          type: "circle",
          color: savedObject.color,
          border: savedObject.border,
          borderWidth: savedObject.borderWidth,
          borderScaleWithZoom: savedObject.borderScaleWithZoom,
          circleCake: savedObject.circleCake,
          radius: savedObject.radius,
          id: savedObject.id,
          image: savedObject.image,
          imageTransformations: {
            rotate: savedObject.flipImage ? Math.PI : 0,
            scale: 1,
            translate: [0, 0]
          }
        });
      }
    });
    let minX = Infinity;
    let maxX = (-Infinity);
    let minY = Infinity;
    let maxY = (-Infinity);
    shapes.forEach((shape) => {
      if (shape.type == "polygon") {
        let polygon = shape;
        polygon.points.forEach((point) => {
          if (point.x < minX)
            minX = point.x;
          if (point.x > maxX)
            maxX = point.x;
          if (point.y < minY)
            minY = point.y;
          if (point.y > maxY)
            maxY = point.y;
        });
      } else if (shape.type == "circle") {
        let circle = shape;
        if (circle.x - circle.radius < minX)
          minX = circle.x - circle.radius;
        if (circle.x + circle.radius > maxX)
          maxX = circle.x + circle.radius;
        if (circle.y - circle.radius < minY)
          minY = circle.y - circle.radius;
        if (circle.y + circle.radius > maxY)
          maxY = circle.y + circle.radius;
      }
    });
    let centerX = (minX + maxX) / 2;
    let centerY = (minY + maxY) / 2;
    shapes.forEach((shape) => {
      shape.x -= centerX;
      shape.y -= centerY;
    });
    return shapes;
  }
