var playMenuMusic = function() {
  try {
    music.currentTime = 5;
    music.volume = 1;
    music.play();
    music.loop = true;
  } catch (e) {
    let click = () => {
      playMenuMusic();
      document.removeEventListener("click", click);
    };
    document.addEventListener("click", click);
  }
};
var stopMenuMusic = function() {
  music.pause();
  music.currentTime = 0;
};
var fadeOutMenuMusic = function() {
  let interval = setInterval(function() {
    music.volume = Math.max(0, music.volume - 0.01);
    if (music.volume <= 0) {
      clearInterval(interval);
      stopMenuMusic();
    }
  }, 10);
};
var playSingleplayer = function() {
  nonGameOverlay.style.display = "none";
  spinner.style.display = "none";
  let startingPopup = document.querySelector(".starting-popup");
  startingPopup.style.display = "block";
  var clientController = new SimuloClientController_default(document.getElementById("game"), true, ambientMusic);
  window.clientController = clientController;
  fadeOutMenuMusic();
};
var playMultiplayer = function() {
  mainMenu.style.display = "none";
  let multiplayerJoinMenu = document.getElementById("multiplayer-join-menu");
  multiplayerJoinMenu.style.display = "flex";
  let clientController = new SimuloClientController_default(document.getElementById("game"), false, ambientMusic);
  window.clientController = clientController;
  let submitJoinCode = document.getElementById("submit-join-code");
  let joinCode = document.getElementById("join-code");
  submitJoinCode.addEventListener("click", function() {
    nonGameOverlay.style.cursor = "wait";
    clientController.client.on("answerSdp", function(encodedSdp) {
      let answerCode = document.getElementById("answer-code");
      answerCode.value = encodedSdp;
      nonGameOverlay.style.cursor = "default";
      let copyAnswerCode = document.getElementById("copy-answer-code");
      copyAnswerCode.addEventListener("click", function() {
        let invisibleAnswerCode = document.createElement("textarea");
        invisibleAnswerCode.value = answerCode.value;
        document.body.appendChild(invisibleAnswerCode);
        invisibleAnswerCode.select();
        document.execCommand("copy");
        document.body.removeChild(invisibleAnswerCode);
        let copiedAnswerCode = document.getElementById("copied-answer-code");
        copiedAnswerCode.classList.add("active");
      });
      let joinStep1 = document.getElementById("join-step-1");
      let joinStep2 = document.getElementById("join-step-2");
      joinStep1.classList.remove("active");
      joinStep2.classList.add("active");
    });
    clientController.client.on("ready", function() {
      nonGameOverlay.style.display = "none";
      fadeOutMenuMusic();
    });
    clientController.client.connect(decodeURIComponent(joinCode.value.trim()));
  });
};
